import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';

@Component({
  selector: 'app-view-all-doctors',
  templateUrl: './view-all-doctors.component.html',
  styleUrls: ['./view-all-doctors.component.css']
})
export class ViewAllDoctorsComponent {
  id:any;
  constructor(private route:ActivatedRoute){
    console.log(this.route.snapshot.params);
    this.id=this.route.snapshot.params['id'];
  }

  allDoctors=[
    {
      doctor_name:'Aboli Pande',
      gender:'Female',
      specialist:'Allergist',
      address:'Nagpur',
      contact_no:'1234567890',
      email_id:'aboli@gmail.com',
      username:'AboliPande',
      password:'aboli123'
    },
    {
      doctor_name:'id.doctor_name',
      gender:'id.gender',
      specialist:'id.specialist',
      address:'id.address',
      contact_no:'id.contact_no',
      email_id:'id.email_id',
      username:'id.username',
      password:'id.password'
    }
  ]
}
